window.bookSummaryJSON = "<p><b>This novelization retells the whole exciting story of the new Disney animated film </b><b><i>Raya and the Last Dragon</i></b><b> - coming to theaters in Spring 2021!</b></p> <p>Walt Disney Animation Studios’ fantasy-action-adventure, <i>Raya and the Last Dragon</i>, introduces Raya, a lone warrior from the fantasy kingdom of Kumandra who teams up with a crew of misfits in her quest to find the last dragon and bring light and unity back to their world. Exploring themes of community and hope, and inspired by the beautiful and diverse cultures of Southeast Asia, this novelization retells the whole exciting story and is perfect for listeners ages eight to 12!</p>"; 
